const leyChileApi = require('./leyChileApi');

const tools = [
  {
    functionDeclarations: [
      {
        name: 'searchLawsByKeyword',
        description: 'Busca normas y leyes chilenas por una palabra clave o frase. Devuelve una lista de las leyes más relevantes que coinciden con la búsqueda.',
        parameters: {
          type: 'OBJECT',
          properties: {
            keyword: {
              type: 'STRING',
              description: 'La palabra clave o frase para buscar. Por ejemplo: "protección de datos", "ley de tránsito".',
            },
            count: {
              type: 'NUMBER',
              description: 'Opcional. El número máximo de resultados a devolver. El valor por defecto es 10.',
            },
          },
          required: ['keyword'],
        },
      },
      {
        name: 'getFullLaw',
        description: 'Obtiene el texto completo y los detalles de una norma o ley específica usando su identificador único (idNorma). Es necesario para leer el contenido de una ley.',
        parameters: {
          type: 'OBJECT',
          properties: {
            idNorma: {
              type: 'STRING',
              description: 'El identificador único de la norma a obtener. Este ID se obtiene de los resultados de la función searchLawsByKeyword.',
            },
          },
          required: ['idNorma'],
        },
      },
    ],
  },
];

const functionHandlers = {
  searchLawsByKeyword: (args) => {
    const { keyword, count } = args;
    return leyChileApi.searchLawsByKeyword(keyword, count);
  },
  getFullLaw: (args) => {
    const { idNorma } = args;
    return leyChileApi.getFullLaw({ idNorma });
  },
};

module.exports = {
  tools,
  functionHandlers,
};
